INSERT INTO `legaldocuments` (`id`, `nombre`, `contenido_html`, `tipo`, `fecha_creacion`, `vigente`, `eliminado`, `version`, `modificado_por`) VALUES
(1, 'AvisoPrivacidad.docx', '<table><tr><td><p><strong>AVISO DE PRIVACIDAD </strong></p></td></tr><tr><td><p> </p></td></tr></table><table><tr><td><p>Alebrije, mejor conocido como Alebrije, con domicilio en calle Velazquez Ibarra 6, colonia Centro, ciudad Huejutla de Reyes, municipio o delegación Huejutla de Reyes, c.p. 43000, en la entidad de Hidalgo, país México, es el responsable del uso y protección de sus datos personales, y al respecto le informamos lo siguiente: </p></td></tr><tr><td><p> </p></td></tr><tr><td><p><strong>¿Para qué fines utilizaremos sus datos personales? </strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Los datos personales que recabamos de usted, los utilizaremos para las siguientes finalidades que son necesarias para el servicio que solicita: </p></td></tr><tr><td></td></tr><tr><td><p><br />De manera adicional, utilizaremos su información personal para las siguientes finalidades secundarias que <strong>no son necesarias</strong> para el servicio solicitado, pero que nos permiten y facilitan brindarle una mejor atención:</p></td></tr><tr><td><ul><li>Para verificar y confirmar su identidad</li><li>Mercadotecnia o publicitaria</li><li>Prospección comercial</li></ul></td></tr><tr><td><p>En caso de que no desee que sus datos personales se utilicen para estos fines secundarios, indíquelo a continuación:<br /><br />No consiento que mis datos personales se utilicen para los siguientes fines:<br /><br />[  ] Para verificar y confirmar su identidad<br />[  ] Mercadotecnia o publicitaria <br />[  ] Prospección comercial </p></td></tr><tr><td></td></tr><tr><td><p><br />La negativa para el uso de sus datos personales para estas finalidades no podrá ser un motivo para que le neguemos los servicios y productos que solicita o contrata con nosotros.</p></td></tr><tr><td><p> </p></td></tr><tr><td><p><strong>¿Qué datos personales utilizaremos para estos fines? </strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Para llevar a cabo las finalidades descritas en el presente aviso de privacidad, utilizaremos los siguientes datos personales:</p><ul><li>Nombre</li><li>Domicilio</li><li>Correo electrónico</li></ul></td></tr></table><table><tr><td><p><strong><br />¿Cómo puede acceder, rectificar o cancelar sus datos personales, u oponerse a su uso? </strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Usted tiene derecho a conocer qué datos personales tenemos de usted, para qué los utilizamos y las condiciones del uso que les damos (Acceso). Asimismo, es su derecho solicitar la corrección de su información personal en caso de que esté desactualizada, sea inexacta o incompleta (Rectificación); que la eliminemos de nuestros registros o bases de datos cuando considere que la misma no está siendo utilizada adecuadamente (Cancelación); así como oponerse al uso de sus datos personales para fines específicos (Oposición). Estos derechos se conocen como derechos ARCO.</p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Para el ejercicio de cualquiera de los derechos ARCO, usted deberá presentar la solicitud respectiva a través del siguiente medio: <br /><br />Llamando al número telefónico (77)-110-63-670 </p></td></tr></table><table><tr><td><p>Para conocer el procedimiento y requisitos para el ejercicio de los derechos ARCO, ponemos a su disposición el siguiente medio:<br /><br />Llamando al número telefónico (77)-110-63-670</p></td></tr></table><table><tr><td><p><br />Los datos de contacto de la persona o departamento de datos personales, que está a cargo de dar trámite a las solicitudes de derechos ARCO, son los siguientes: </p></td></tr><tr><td><p> </p></td></tr><tr><td><p>a) Nombre de la persona o departamento de datos personales: Bernardo Hernández Cruz<br />b) Domicilio: calle Velázquez Ibarra 6, colonia Centro, ciudad Huejutla de Reyes, municipio o delegación Huejutla de Reyes, c.p. 43000, en la entidad de Hidalgo, país México<br />c) Correo electrónico: br_hcruz@hotmail.com<br /><br /><strong>Usted puede revocar su consentimiento para el uso de sus datos personales</strong><br /><br />Usted puede revocar el consentimiento que, en su caso, nos haya otorgado para el tratamiento de sus datos personales. Sin embargo, es importante que tenga en cuenta que no en todos los casos podremos atender su solicitud o concluir el uso de forma inmediata, ya que es posible que por alguna obligación legal requiramos seguir tratando sus datos personales. Asimismo, usted deberá considerar que para ciertos fines, la revocación de su consentimiento implicará que no le podamos seguir prestando el servicio que nos solicitó, o la conclusión de su relación con nosotros.<br /><br />Para revocar su consentimiento deberá presentar su solicitud a través del siguiente medio: <br /><br />Desde la página web </p></td></tr><tr><td><p><br />Para conocer el procedimiento y requisitos para la revocación del consentimiento, ponemos a su disposición el siguiente medio:<br /><br />Desde la página de Internet</p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p><strong>¿Cómo puede limitar el uso o divulgación de su información personal? </strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Con objeto de que usted pueda limitar el uso y divulgación de su información personal, le ofrecemos los siguientes medios: <br /><br />Desde la página de Internet</p></td></tr><tr><td><p> </p></td></tr></table><table><tr><td><p><strong><br />¿Cómo puede conocer los cambios en este aviso de privacidad?</strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>El presente aviso de privacidad puede sufrir modificaciones, cambios o actualizaciones derivadas de nuevos requerimientos legales; de nuestras propias necesidades por los productos o servicios que ofrecemos; de nuestras prácticas de privacidad; de cambios en nuestro modelo de negocio, o por otras causas.<br /><br />Nos comprometemos a mantenerlo informado sobre los cambios que pueda sufrir el presente aviso de privacidad, a través de: Por medio de correo electrónico.<br /><br />El procedimiento a través del cual se llevarán a cabo las notificaciones sobre cambios o actualizaciones al presente aviso de privacidad es el siguiente: <br /><br />Se enviará un correo electrónico para que el usuario se encuentre enterado que se llevaron modificaciones al aviso de privacidad.</p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p><strong>Su consentimiento para el tratamiento de sus datos personales</strong> </p></td></tr></table><table><tr><td><p>Consiento que mis datos personales sean tratados de conformidad con los términos y condiciones informados en el presente aviso de privacidad.<strong>[  ]</strong> </p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p>Última actualización: 12/10/2024 </p></td></tr></table>', 'terminos', '2024-10-24 16:49:13', 1, 0, 1.0, NULL),
