car su consentimiento para el uso de sus datos personales</strong><br /><br />Usted puede revocar el consentimiento que, en su caso, nos haya otorgado para el tratamiento de sus datos personales. Sin embargo, es importante que tenga en cuenta que no en todos los casos podremos atender su solicitud o concluir el uso de forma inmediata, ya que es posible que por alguna obligación legal requiramos seguir tratando sus datos personales. Asimismo, usted deberá considerar que para ciertos fines, la revocación de su consentimiento implicará que no le podamos seguir prestando el servicio que nos solicitó, o la conclusión de su relación con nosotros.<br /><br />Para revocar su consentimiento deberá presentar su solicitud a través del siguiente medio: <br /><br />Desde la página web </p></td></tr><tr><td><p><br />Para conocer el procedimiento y requisitos para la revocación del consentimiento, ponemos a su disposición el siguiente medio:<br /><br />Desde la página de Internet</p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p><strong>¿Cómo puede limitar el uso o divulgación de su información personal? </strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>Con objeto de que usted pueda limitar el uso y divulgación de su información personal, le ofrecemos los siguientes medios: <br /><br />Desde la página de Internet</p></td></tr><tr><td><p> </p></td></tr></table><table><tr><td><p><strong><br />¿Cómo puede conocer los cambios en este aviso de privacidad?</strong></p></td></tr><tr><td><p> </p></td></tr><tr><td><p>El presente aviso de privacidad puede sufrir modificaciones, cambios o actualizaciones derivadas de nuevos requerimientos legales; de nuestras propias necesidades por los productos o servicios que ofrecemos; de nuestras prácticas de privacidad; de cambios en nuestro modelo de negocio, o por otras causas.<br /><br />Nos comprometemos a mantenerlo informado sobre los cambios que pueda sufrir el presente aviso de privacidad, a través de: Por medio de correo electrónico.<br /><br />El procedimiento a través del cual se llevarán a cabo las notificaciones sobre cambios o actualizaciones al presente aviso de privacidad es el siguiente: <br /><br />Se enviará un correo electrónico para que el usuario se encuentre enterado que se llevaron modificaciones al aviso de privacidad.</p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p><strong>Su consentimiento para el tratamiento de sus datos personales</strong> </p></td></tr></table><table><tr><td><p>Consiento que mis datos personales sean tratados de conformidad con los términos y condiciones informados en el presente aviso de privacidad.<strong>[  ]</strong> </p></td></tr></table><table><tr><td><p> </p></td></tr><tr><td><p>Última actualización: 12/10/2024 </p></td></tr></table>', 'privacidad', '2024-10-24 16:56:49', 1, 0, 1.0, NULL);
